import React, { useState, useEffect } from "react";
import Form from "react-bootstrap/Form";
import Col from "react-bootstrap/Col";
import Card from "react-bootstrap/Card";
import Row from "react-bootstrap/Row";
import { Link, useParams } from "react-router-dom";
import Button from "react-bootstrap/Button";
import axios from "axios";
import { Alert, Navbar } from "react-bootstrap";
import api from "../../api/axiosConfig";

export default function Transfer(props) {
  const { userID } = useParams();
  const [amount, setAmount] = useState(0);
  const [accountID1, setAccountID1] = useState(0);
  const [accountID2, setAccountID2] = useState(0);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const handleTransferClick = (event) => {
    event.preventDefault();

    if (isNaN(amount) || amount <= 0) {
      setError("Invalid transfer amount. Please enter a valid amount.");
      return;
    }

    const transferAmmount = parseFloat(amount);
    setLoading(true);
    api
      .put(
        `/api/v1/user/${userID}/${accountID1}/${accountID2}`,
        transferAmmount,
        { headers: { "Content-Type": "application/json" } }
      )
      .then((response) => {
        //console.log(response.data);
        setAmount(0);
        props.updateUser(props.getUser());
        setError(null);

        setLoading(false);
      })
      .catch((error) => {
        console.error(error);
        setError("Transfer failed");
        setLoading(false);
      });
  };
  return (
    <div>
      <Row className="mb-3 justify-content-md-center">
        <Card border="dark" style={{ width: "40rem" }}>
          <Card.Title>
            <h2>Transfer</h2>
          </Card.Title>
          <Form.Group as={Row} className="mb-1">
            <Form.Label column sm={5}>
              <h3>Transfer from:</h3>
            </Form.Label>
            <Col sm={3}>
              <Form.Control
                value={accountID1}
                onChange={(e) => setAccountID1(e.target.value)}
              />
            </Col>
          </Form.Group>
          <Form.Group as={Row} className="mb-1">
            <Form.Label column sm={5}>
              <h3>Transfer to:</h3>
            </Form.Label>
            <Col sm={3}>
              <Form.Control
                value={accountID2}
                onChange={(e) => setAccountID2(e.target.value)}
              />
            </Col>
          </Form.Group>
          <Form.Group as={Row} className="mb-1">
            <Form.Label column sm={5}>
              <h3>Transfer amount:</h3>
            </Form.Label>
            <Col sm={3}>
              <Form.Control
                value={amount}
                onChange={(e) => setAmount(e.target.value)}
              />
            </Col>
          </Form.Group>
          <Row className="justify-content-md-center">
            <Col sm={2}>
              <Button
                variant="dark"
                onClick={handleTransferClick}
                className="mb-3"
              >
                {loading ? <>Loading..</> : <>Submit</>}
              </Button>
            </Col>
          </Row>
          {
            <Row className="justify-content-md-center">
              <Col sm={7}>
                {error && <Alert variant="danger">{error}</Alert>}
              </Col>
            </Row>
          }
        </Card>
      </Row>
    </div>
  );
}
